This application contains all information about the game Empire of Puzzles: description and characteristics of heroes; information about events, quests; best places for closing chests and much more; titan info. A lot of useful things and tools will be found here both beginners and experienced players. Work on the application continues, we are open to suggestions, wishes and criticism.

Futures and toolbox:
- news and updates of the game;
- complete information about buildings of the game, included food, iron and time calculator;
- convenient database of heroes with search and filters;
- for each hero full information is given: characteristics, abilities, emblem calculator, features and tips of use;
- collected all the necessary information about Atlantis, Valhalla, Legend Tavern, Masquerade and other events.


In the following update:
- we are starting work on troop descriptions and tools;
- more articles for beginners.

Important. The application contains links to our groups in popular instant messengers. Users feedback is an important element of development, we are waiting for your thoughts. We want to add all needed info and tools to our free app.

This is a non-commercial app created for fans of the game. Content is not associated with, sponsored or approved by Small Giant Games. Small Giant Games is not responsible for it. We have no connection with the game developers!
